UPDATE `broadcast_text_locale` SET `Text1_lang`='강화는 기본적으로 용맹석이 필요하니, 틈틈이 모아두세요.\n\n그리고 모험가, 노련가, 챔피언, 영웅, 신화 표시가 된 장비를 강화하는 데는 일반적으로 문장이 추가로 필요합니다. 각 강화별로 적절한 문장이 15개씩 필요합니다. 쿠졸스나 다른 강화 상인이 각 강화 단계별로 어떤 문장이 필요한지 자세히 알려줄 겁니다.\n\n그리고 기존에 강화한 수준보다 성능이 떨어지는 동일 부위 장비를 가져와 강화할 때는 용맹석은 절반만 필요하고, 문장은 아예 없어도 됩니다. 예시를 들어보죠. 용사님이 강력한 망토를 보유하고 있다고 해 보겠습니다. 이때 다른 망토를 가져와 그 망토와 비슷한 수준까지 강화하겠다고 하면 소모되는 비용이 대폭 줄어드는 셈입니다.', `VerifiedBuild`=59888 WHERE (`VerifiedBuild`>0 AND `ID`=265451 AND `locale`='koKR');
UPDATE `broadcast_text_locale` SET `Text1_lang`='용맹석은 카즈 알가르 전역과 지하에서 구할 수 있습니다. 야외 보물을 개봉하거나, 전역 퀘스트를 완료하거나, 주간 이벤트에 참여하거나, 구렁이나 던전, 공격대를 공략해 획득할 수 있죠.\n\n문장도 비슷한 방법으로 얻습니다. 문장은 4단계로 나뉩니다. 위험한 모험을 극복할수록 강력한 문장을 획득할 수 있죠.', `VerifiedBuild`=59888 WHERE (`VerifiedBuild`>0 AND `ID`=265445 AND `locale`='koKR');
UPDATE `broadcast_text_locale` SET `Text1_lang`='반갑습니다, 친구여!\n\n도르노갈에 자리를 잡은 지도 제법 시간이 지났는데, 요즘 새로운 종류의 문장이 종종 보이더군요! 언더마인 문장이라고 하는데, 용맹석과 궁합이 아주 잘맞는 유물입니다.\n\n당연한 얘기지만 쿠졸스는 벌써 그것들을 사용해 모험 장비를 강화하는 방법을 개발했습니다. 저요? 전 아직 문장 변환을 실험 중이고요.\n\n늘 그래왔듯이.\n\n아, 불평하는 건 아닙니다. 용사님과 다른 모험가분들께 도움이 될 수 있어서 얼마나 좋은데요. 전... 여기 남을 겁니다. 싸우는 재주가 있는 것도 아니니.', `VerifiedBuild`=59888 WHERE (`VerifiedBuild`>0 AND `ID`=265441 AND `locale`='koKR');
