INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(279384, 'koKR', '대지주배 파괴 대회', '대지주배 파괴 대회', 59888),
(279845, 'koKR', '안 돼...', '', 59888),
(275804, 'koKR', '돈이 얼마나 깨졌는지 알아? 네놈을 쥐어짜서 충당할 거다, 가즈로!', '', 59888),
(268880, 'koKR', '선장이 갤리윅스의 회유 따위는 덮어두고 올바른 일을 하는 걸 보니 가슴이 뜨거워지지 뭡니까?', '', 59888),
(271175, 'koKR', '', '한창 재밌었는데...', 59888),
(271159, 'koKR', '', '내 특급 무장이! 너...! 네 친구 렌직 뒤를 따라갈 각오는 됐겠지!', 59888),
(268888, 'koKR', '대장, 이거 갤리윅스 검은 피!', '', 59888),
(268887, 'koKR', '네놈들 화물은 우리 차지다!', '', 59888),
(275706, 'koKR', '뼛속까지 흔들릴 거다!', '', 59888),
(275703, 'koKR', '고기가 지글지글 익으려면 얼마나 가열해야 하지?', '', 59888),
(275100, 'koKR', '내 차례다! 먼지로 만들어 주마!', '', 59888),
(275029, 'koKR', '떡이 되도록 두들겨 패주마!', '', 59888),
(274595, 'koKR', '큰돈, 큰 포상!', '', 59888),
(275947, 'koKR', '죽기 전에 이 몸의 얼굴을 잘 봐두라고.', '', 59888),
(275944, 'koKR', '빚 갚아라, 멍청이들아!', '', 59888),
(275943, 'koKR', '야! 퍼뜩 안 나오냐?!', '', 59888),
(282252, 'koKR', '줌카트입니다, 재판장님. 국선 변호사 줌카트.', '', 59888),
(282250, 'koKR', '정말입니다, 재판장님. 허락만 해주신다면 이 법의 역사를 맥락에 맞게 설명해 드릴 수도...', '', 59888),
(282246, 'koKR', '재판장님, 사실 갤라지오는 소유주가 있습니다.', '', 59888),
(282244, 'koKR', '간단합니다, 재판장님. 소유주가 사망했습니다. 그러니 경매에 부쳐야 합니다!', '', 59888),
(281492, 'koKR', '마티 줌카트도 준비됐습니다. 이상입니다, 재판장님.', '', 59888),
(281491, 'koKR', '타르보나라 피즐크랭크는 준비됐습니다. 겸손하고 정중하게 협조하겠습니다, 재판장님.', '', 59888),
(276966, 'koKR', '재판장님. 타르보나라는 법정에 폭탄 게도 설치했습니다. $p 님이 해체했고요.', '', 59888),
(276963, 'koKR', '재판장님, 답은 분명합니다! 살인범은... $p일 수밖에 없습니다!', '', 59888),
(276962, 'koKR', '재판장님. 방금 로즈버드 갤리윅스 살해범이 오늘 법정에 와 있다는 증거를 입수했습니다!', '', 59888),
(280948, 'koKR', '', '먹을 거 찾으세요? \"집에서 즐기는 토크\"는 어때요? 돈으로 살 수 있는 최고의 사진 촬영 기회예요! 그리고 *이건* 사람이나 소규모 사업체를 부수지도 않아요!\n\n...전에 문제였던 건 비밀이지만...', 59888),
(280946, 'koKR', '아직 정리할 게 좀 남았어. 혁명 때문에 좀 자극이 과했던 것 같아.\n\n페이세터의 외모 개조 장치 한번 사용해 볼래? 새로 태어난 기분, 아니, 더 좋아진 기분이 들걸!', '', 59888),
(280940, 'koKR', '이런, 이런... 내 작업에 끼어들려고? 미안하지만, 나는 푼돈으로는 절대 만족 못 해. 돈을 더 벌어서 다시 와. 그땐 나랑 거래할 기회가 생길 테니.', '', 59888),
(280939, 'koKR', '접수처에서 사장님한테 연락했어. 자네하고 친구들은 들여보내도 된다고 하더라고. 뭐... 경험이 충분하다는 전제하에 말이야. 이렇게 하자. 머그지를 제칠 실력이 있다는 걸 증명해. 그럼 언제든지 밀실로 보내줄게.\n\n이 갤라지오에서 자네의 충성심은 갖는 의미가 커. *심지어* 이 장소를 박살 낸 장본인이라고 해도 말이야!', '', 59888),
(280933, 'koKR', '대장이 그러는데 가짜 무기가 있다는 걸 모르는 사람한테 말하면 안 된대. 진짜가 아니라서 관광객들한테 진짜인 척 팔기가 더 쉽다나 뭐라나.\n\n그러니까 아무한테도 말하지 마. *특히* 모르는 사람한테는.', '', 59888),
(280080, 'koKR', '<분노한 포효>', '', 59888),
(279822, 'koKR', '', '다음에 또 봐.', 59888),
(275813, 'koKR', '까칠하기도 하셔라. 날 쫓아내고 싶어? 계속 전진해. 조만간 만날 수 있어.', '', 59888),
(275810, 'koKR', '그리고 너희는 허락을 받지 못했지! 안 그래, 머그?', '', 59888),
(275777, 'koKR', '그렇지! 갤리윅스가 이걸 보면 완전히 뒤집어질 거야! 물론, 안 그럴 수도 있긴 한데. 흠. 시장 조사를 좀 해봐야겠네.', '', 59888),
(275539, 'koKR', '', '에이. 막 재밌어지던 참이었는데!', 59888),
(275363, 'koKR', '', '끝이다!', 59888),
(275239, 'koKR', '자 그럼 경기를... 어, 한마디만 듣고 재개하겠습니다!', '', 59888),
(269863, 'koKR', '', '전 여러분처럼 무역왕은 아니지만, 언더마인의 더 나은 미래를 위해 싸울 거예요.', 59888);
