(3226, 'koKR', '시장 연구 자료', '다크퓨즈 흥신사무소는 역량을 투입할 분야를 찾아 시장 연구 자료를 구하고 있습니다. 허름언덕에 있는 스티치 로우다운을 찾아가면 시장 연구 자료를 다크퓨즈 흥신사무소 평판으로 교환할 수 있습니다.', 59888),
(3135, 'koKR', '11.1 Delves - Personal Tracker - S2 Weekly Elise Turn-In(Hidden)', '', 59888),
(2803, 'koKR', '지하의 주화', '탐험가들이 비밀이나 금은보화와 관련된 풍문을 교환할 때 흔히 사용하는 화폐입니다.', 59888),
