(2640, 'koKR', '살육의 도가니', '역사상 장엄한 전쟁은 수없이 있었지만, 번개 고릴라 폭풍우 토크와 불타는 메카사우루스 격노한 자 플레렌도 사이의 경쟁만큼 폭발적인 건 없었습니다. 그리고 오늘 밤, 이 두 경쟁자가 모든 것을 걸고 언더마인을 둘로 갈라놓을 것만 같은 대결을 펼칩니다! 학살의 현장을 목격하거나, 아니면 고블린 종족의 수치가 되거나, 둘 중 하나를 선택하세요.', 59888);
