(30331, 'koKR', '개요', '플레렌도와 토크가 관중에게 구경거리를 선사하며, |cFF2959D3|Hspell:473650|h[고철폭탄]|h|r을 던지고 투기장 전투원에게 |cFF2959D3|Hspell:473951|h[전하 충전]|h|r을 겁니다. \n기력이 100에 도달하면 플레렌도와 토크가 함께 |cFF2959D3|Hspell:465833|h[거대한 격돌]|h|r을 시작합니다!', 59888),
(27555, 'koKR', '치유 담당', '$bullet; |cFF2959D3|Hspell:424739|h[혼돈의 타락]|h|r은 만료 시 분출을 일으키고 가장 가까운 플레이어에게 전이됩니다.\n$bullet;|cFF2959D3|Hspell:424739|h[혼돈의 타락]|h|r은 현재 대상에게 주기적인 피해를 입힙니다.\n$bullet;|cFF2959D3|Hspell:425052|h[암흑의 중력]|h|r은 지속시간 동안 모든 플레이어에게 피해를 입힙니다.', 59888),
(30489, 'koKR', '공격 담당', '$bullet;|cFF2959D3|Hspell:465952|h[악독 폭탄 대잔치]|h|r와 |cFF2959D3|Hspell:1214607|h[살벌 흉악 폭탄 작렬]|h|r 추가로 |cFF2959D3|Hspell:466158|h[공병의 주머니]|h|r와 |cFF2959D3|Hspell:1214755|h[과부하된 로켓]|h|r을 발동시킵니다.\n$bullet;다크퓨즈 기술병은 사망 시 초강력 폭탄을 떨어뜨리며, $1223905D 후에 |cFF2959D3|Hspell:1223905|h[초강력 쾅!]|h|r을 발동시킵니다. 갤리윅스의 |cFF2959D3|Hspell:469327|h[초강력 작렬]|h|r은 초강력 폭탄을 즉시 폭발시킵니다.\n$bullet;|cFF2959D3|Hspell:469362|h[충전된 초강력 폭탄]|h|r을 초강력 제어기로 가져가면 |cFF2959D3|Hspell:469767|h[초강력 폭탄 폭파]|h|r가 발동해 |cFF2959D3|Hspell:1220846|h[제어기 용해]|h|r가 일어나고, 갤리윅스의 |cFF2959D3|Hspell:469286|h[초강력 감줄]|h|r이 방해를 받습니다.\n$[15,16$bullet;저격 파수기는 제어하지 않으면 |cFF2959D3|Hspell:466834|h[전격 탄막]|h|r으로 큰 피해를 입힙니다.$]', 59888),
(30488, 'koKR', '치유 담당', '$bullet;|cFF2959D3|Hspell:1220761|h[기계복 기술자의 용기]|h|r에 영향을 받는 플레이어는 효과가 소모되거나 만료되면 |cFF2959D3|Hspell:474447|h[용기 폭파]|h|r가 발동합니다.\n$bullet;다크퓨즈 기술병은 사망 시 초강력 폭탄을 떨어뜨리며, $1223905D 후에 |cFF2959D3|Hspell:1223905|h[초강력 쾅!]|h|r을 발동시킵니다. 갤리윅스의 |cFF2959D3|Hspell:469327|h[초강력 작렬]|h|r은 초강력 폭탄을 즉시 폭발시킵니다.\n$bullet;|cFF2959D3|Hspell:469362|h[충전된 초강력 폭탄]|h|r을 초강력 제어기로 가져가면 |cFF2959D3|Hspell:469767|h[초강력 폭탄 폭파]|h|r가 발동해 |cFF2959D3|Hspell:1220846|h[제어기 용해]|h|r가 일어나고, 갤리윅스의 |cFF2959D3|Hspell:469286|h[초강력 감줄]|h|r이 방해를 받습니다.\n$bullet;|cFF2959D3|Hspell:469286|h[초강력 감줄]|h|r, |cFF2959D3|Hspell:466338|h[오락가락 지글지글]|h|r, |cFF2959D3|Hspell:1214369|h[총체적인 파괴!!!]|h|r는 막대한 피해를 입힙니다.', 59888),
