(31956, 'koKR', '공격 담당', '$bullet;|cFF2959D3|Hspell:468846|h[도약하는 불꽃]|h|r은 플레이어를 추격하며, 접촉 시 기절시킵니다.\n$bullet;|cFF2959D3|Hspell:465279|h[댐 용수]|h|r는 기즐의 전기 능력과 접촉 시 전기가 흐르게 됩니다.\n$bullet;|cFF2959D3|Hspell:465463|h[터보 충전]|h|r과 |cFF2959D3|Hspell:468813|h[기가 감전]|h|r은 막대한 피해를 입힙니다.', 59888),
(31102, 'koKR', '방어 담당', '$bullet; 리크는 |cFF2959D3|Hspell:466128|h[공명]|h|r을 통해 주위의 증폭기에 추가 동력을 공급합니다. \n$bullet; |cFF2959D3|Hspell:464488|h[음파 파열]|h|r은 전방 부채꼴 범위에 음파 피해를 입히며 |cFF2959D3|Hspell:464518|h[이명 현상]|h|r을 겁니다. 음파 피해는 방패로 막지 못하며 방어도에 관계없이 피해를 받습니다.\n$bullet; 증폭기의 |cFF2959D3|Hspell:466722|h[분출]|h|r은 플레이어를 공중으로 날려 보내며, 리크는 치명적인 |cFF2959D3|Hspell:467991|h[요란스러운 투하]|h|r를 발동시킵니다.', 59888),
(30506, 'koKR', '방어 담당', '$bullet;|cFF2959D3|Hspell:466518|h[녹아내린 황금 너클]|h|r은 머그 전방의 플레이어에게 막대한 피해를 입히며, |cFF2959D3|Hspell:467202|h[황금 방울]|h|r을 겁니다.\n$bullet;|cFF2959D3|Hspell:469490|h[2중 장애 사격]|h|r은 가까이에서 적중당할수록 받는 피해가 완화됩니다.', 59888),
(30486, 'koKR', '개요', '갤리윅스는 서서히 기력을 회복하며, 크롬 궁전의 |cFF2959D3|Hspell:469286|h[초강력 감줄]|h|r을 최대 용량으로 활성화합니다. |cFF2959D3|Hspell:469362|h[충전된 초강력 폭탄]|h|r을 초강력 제어기로 가져오면 |cFF2959D3|Hspell:469767|h[초강력 폭탄 폭파]|h|r가 발동합니다. 그 결과 |cFF2959D3|Hspell:1220846|h[제어기 용해]|h|r가 발동해 갤리윅스의 |cFF2959D3|Hspell:469286|h[초강력 감줄]|h|r이 방해를 받습니다. 초강력 제어기 2개가 모두 사라지면 |cFF2959D3|Hspell:1215209|h[파괴 지대]|h|r가 형성됩니다.\n\n추가로 전투가 진행되는 동안 갤리윅스는 막대한 봉급을 받는 다크퓨즈 수하를 불러 전투를 돕게 합니다.\n\n전투가 격화될수록 갤리윅스는 자신의 무기를 변형하거나 증강하여 엄청난 아수라장을 만듭니다.$[14,15,17$ 생명력이 50% 이하로 떨어지면 갤리윅스가 적을 완전히 말살하고자 자신의 능력을 강화합니다.$]', 59888),
(30082, 'koKR', '치유 담당', '$bullet;|cFF2959D3|Hspell:461060|h[당첨 기원!]|h|r의 지속시간 동안 2개의 징표가 삽입되지 않거나 같은 조합 결과가 반복될 경우, 외팔이 좀도둑이 |cFF2959D3|Hspell:461068|h[사기 적발!]|h|r을 사용합니다.\n$bullet;|cFF2959D3|Hspell:460164|h[오염된 배출]|h|r은 모든 플레이어의 이동 속도를 감소시키고 대량의 치유 효과를 흡수합니다.\n$bullet;|cFF2959D3|Hspell:460181|h[당첨선]|h|r 칩 주위에 서 있으면 |cFF2959D3|Hspell:460444|h[큰손 도박꾼!]|h|r이 부여됩니다.', 59888),
