(30951, 'koKR', '치유 담당', '$bullet;|cFF2959D3|Hspell:460867|h[쿵 콰광 펑]|h|r으로 생성된 똑딱이 폭탄은 만료 시 모든 플레이어에게 막대한 피해를 입힙니다.\n$bullet;|cFF2959D3|Hspell:459779|h[날쌘 돌진]|h|r 사용 시 브론트는 |cFF2959D3|Hspell:460867|h[쿵 콰광 펑]|h|r으로 생성된 똑딱이 폭탄을 포함해 경로에 있는 모든 물체를 통과합니다.\n$bullet;$[8,23|cFF2959D3|Hspell:473690|h[충격 폭발젤]|h|r은 무효화될 때 주위의 똑딱이 폭탄을 공중으로 날려 보냅니다.$]', 59888),
(30950, 'koKR', '방어 담당', '$bullet;|cFF2959D3|Hspell:460867|h[쿵 콰광 펑]|h|r으로 생성된 똑딱이 폭탄은 만료 시 모든 플레이어에게 막대한 피해를 입힙니다.\n$bullet;|cFF2959D3|Hspell:459779|h[날쌘 돌진]|h|r 사용 시 브론트는 |cFF2959D3|Hspell:460867|h[쿵 콰광 펑]|h|r으로 생성된 똑딱이 폭탄을 포함해 경로에 있는 모든 물체를 통과합니다.', 59888),
