(31132, 'koKR', '공격 담당', '$bullet; 쿨타로크는 |cFF2959D3|Hspell:473959|h[영혼 끌어내기]|h|r로 플레이어의 영혼을 뜯어냅니다. 영혼이 쿨타로크에게 도달하면 쿨타로크가 괴저 마력을 주입해 |cFF2959D3|Hspell:474013|h[영혼의 타락]|h|r을 발동시킵니다.\n$bullet; |cFF2959D3|Hspell:1216474|h[죽음의 소용돌이]|h|r는 회전하는 강령술 보주를 만들어내며, 접촉하는 플레이어에게 암흑 피해를 입힙니다.', 59888),
(28414, 'koKR', '개요', '양조장인 알드리르는 잿불맥주의 폭발적인 위력을 이용해 |cFF2959D3|Hspell:432198|h[이글거리는 트림]|h|r과 |cFF2959D3|Hspell:432182|h[잿불맥주 던지기]|h|r로 플레이어를 공격합니다.\n\n생명력이 66% 및 33% 이하로 떨어지면 양조장인 알드리르는 |cFF2959D3|Hspell:442525|h[즐거운 시간]|h|r을 시작해 목마른 손님이 |cFF2959D3|Hspell:431896|h[고성방가]|h|r를 내지르게 합니다.', 59888),
(22652, 'koKR', '공격 담당', '$bullet;|cFF2959D3|Hspell:333292|h[이글거리는 죽음]|h|r은 주위의 아군에게 피해를 입힙니다.\n$bullet;기력이 100에 도달하면 맹독의 파세란이 플레이어를 |cFF2959D3|Hspell:320182|h[유해 포자]|h|r의 대상으로 지정합니다.', 59888),
(22650, 'koKR', '방어 담당', '$bullet;|cFF2959D3|Hspell:320069|h[필사의 일격]|h|r은 받는 모든 치유 효과를 감소시킵니다.\n$bullet;기력이 100에 도달하면 맹독의 파세란이 플레이어를 |cFF2959D3|Hspell:320182|h[유해 포자]|h|r의 대상으로 지정합니다.', 59888),
