(21580, 'koKR', '공격 담당', '$bullet;도전자는 사망 시 남은 도전자에게 |cFF2959D3|Hspell:1215747|h[최후의 의지]|h|r를 부여합니다.\n$bullet;|cFF2959D3|Hspell:333292|h[이글거리는 죽음]|h|r은 주위의 아군에게 피해를 입힙니다.\n$bullet;기력이 100에 도달하면 맹독의 파세란이 플레이어를 |cFF2959D3|Hspell:320182|h[유해 포자]|h|r의 대상으로 지정합니다.', 59888),
(21579, 'koKR', '치유 담당', '$bullet;|cFF2959D3|Hspell:320069|h[필사의 일격]|h|r은 받는 모든 치유 효과를 감소시킵니다.\n$bullet;|cFF2959D3|Hspell:333292|h[이글거리는 죽음]|h|r은 주위의 아군에게 피해를 입힙니다.\n$bullet;|cFF2959D3|Hspell:1215600|h[메말리는 손길]|h|r은 무효화될 때까지 대상 플레이어에게 지속적으로 암흑 피해를 입힙니다.', 59888),
(21577, 'koKR', '개요', '세 명의 도전자를 모두 쓰러뜨려 가치를 입증해 보여야 합니다. 각각의 도전자는 기력이 100에 도달하면 강력한 능력을 사용합니다.', 59888),
(19233, 'koKR', '방어 담당', '$bullet;백금 난타로봇을 |cFF2959D3|Hspell:282943|h[피스톤 분쇄기]|h|r의 범위 내로 유인하면 |cFF2959D3|Hspell:282801|h[백금 장갑]|h|r 중첩이 제거됩니다.', 59888);
