INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2345, 'koKR', '미크시 찻잔터럭', '|cFFFFD200게임 내 상점|r|n', '찻잔터럭은 향긋한 차를 제공하기로 유명합니다. 다만 워낙 쾌활한 성격이라 지나치게 흘릴 때도 있습니다.', 59888),
(2344, 'koKR', '미크시 둘둘발바닥', '|cFFFFD200게임 내 상점|r|n', '둘둘발바닥은 차를 대접하는 일에 깊은 자부심을 품고 있습니다. 여행 동료에게 따뜻한 차 한잔을 대접하기를 한 번도 소홀히 하지 않죠.', 59888),
(2343, 'koKR', '미크시 부들발바닥', '|cFFFFD200게임 내 상점|r|n', '부들발바닥은 아침에 정신을 차리거나 밤을 지샐 때 좋은 홍차를 제공합니다.', 59888),
(2342, 'koKR', '미크시 펄럭모피', '|cFFFFD200게임 내 상점|r|n', '펄럭모피는 쾌활하면서도 덤벙대며, 청결에 집착합니다. 하나로 놓고 보면 무시무시한 성격적 특성이죠.', 59888),
(2489, 'koKR', '진줏빛 나비', '|cFFFFD200교역소|r', '오색빛깔로 반짝반짝 빛나는 나비에 몸을 싣고 하늘 높이 날아오르세요.', 59888),
(2288, 'koKR', '맞춤형 고블린 폐.품 처분기', '|cFFFFD200획득:|r 잘 거른 고물 더미|n|cFFFFD200지역:|r 언더마인', '고블린 벌목기는 벌목부터 수송 등 수없이 많은 용도로 활용할 수 있음이 증명됐습니다. 이 모델은 폐.품.단에서 사용할 목적으로 개조됐습니다.', 59888),
(2346, 'koKR', '미크시 찻물도둑', '|cFFFFD200게임 내 상점|r|n', '천성이 짓궂고 장난기가 많은 편이지만, 여행길을 함께하는 동료로서 충직하고 믿음직합니다.', 59888),
(2296, 'koKR', '구렁 탐험가의 고블린 쾌속정', '|cFFFFD200전역 퀘스트: |r내 모자 내놔|n|cFFFFD200지역: |r도른의 섬|n|cFFFFD200지역: |r도르노갈', '이 비행선은 목적지가 어디든 곧장 모험을 떠날 수 있게 해줍니다. 물론, 그전에 폭발하지만 않는다면요!', 59888),
(2279, 'koKR', '천둥북 오발탄', '|cFFFFD200상인: |r총잡이 안도|n|cFFFFD200지역: |r언더마인 해방전선|n|cFFFFD200가격: |r500|TINTERFACE\\MONEYFRAME\\UI-GOLDICON.BLP:0|t', '도가니에서 유난히 잔혹한 경기가 벌어졌던 날, 관람석에서 회수된 물건입니다. 오발탄이 아니냐는 물음에 토크의 조작수는 짧은 대답으로 응수했습니다. \'아마도?\'', 59888),
(2276, 'koKR', '다크퓨즈 잡식기', '|cFFFFD200상인: |r총잡이 안도|n|cFFFFD200지역: |r언더마인 해방전선|n|cFFFFD200가격: |r500|TINTERFACE\\MONEYFRAME\\UI-GOLDICON.BLP:0|t', '스틱스의 고철장 하이에나 사이에서도 우두머리로 여겨지며, 갤리윅스가 처리하려는 거라면 무엇이든, 누구든 씹어 삼킬 수 있는 치악력을 자랑합니다.', 59888),
(1471, 'koKR', '복수', '|cFFFFD200획득:|r 여군주 실바나스 윈드러너|n|cFFFFD200지역:|r 지배의 성소|n|cFFFFD200난이도:|r 신화', '아서스에게 목숨을 잃던 날, 실바나스는 자신의 일부를 잃었습니다. 그렇게 내면의 빈자리를 채우기 위해 어둠은 커졌습니다.', 59888);
