(12933, 'koKR', '머그지는 난공불락과도 같은 갤리윅스의 카지노, 갤라지오의 보안을 총괄합니다. 이 강력한 오우거를 꺾어야지만 크롬왕에게 다가설 수 있습니다.', '머리 하나보다는 둘', 59888),
(12902, 'koKR', '스프로켓몽거 로켄스톡은 기계공학의 거장으로, 그의 조립 공장에서는 끊임없이 파괴 병기가 생산되고 있습니다. 로켄스톡이 언더마인을 연기가 피어오르는 구덩이로 만들기 전에 막아야 합니다.', '광기의 기계공', 59888);
