INSERT INTO `warband_scene_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `Source_lang`, `VerifiedBuild`) VALUES
(25, 'koKR', '갤라지오 대회랑', '갤리윅스가 언더마인을 등골 휘도록 착취하고 있긴 합니다만, 안목 하나는 대단합니다!', '|cFFFFD200업적:|r 고블린적 사고', 59888),
(7, 'koKR', '풍요산지 샘', '풍요산지의 토석인들이 저명한 모험가에게 기꺼이 내준 자리입니다. 뒷정리만 잘해달라네요.', '|cFFFFD200업적:|r 카즈 알가르의 모든 것', 59888),
(4, 'koKR', '온아라 전망대', '아제로스를 누비는 모험가로서 이보다 더 경치 좋은 장소를 찾긴 대단히 어려울 겁니다.', '', 59888);
